import React from "react";
import "./M&v.css";
import { Container, Row } from "react-bootstrap";
import img1 from "./M&vimg/mission-vision1.jpg";
function Mission() {
  return (
    <div>
      <Container>
        <Row>
          <div className="col-md-3">
            <img src={img1} alt="" className="img1" />
          </div>
        </Row>
      </Container>
    </div>
  );
}
export default Mission;
